function HeaderLeftButtons(props) {
    return (
      <ul class="navbar-nav me-auto mb-2 mb-lg-0 justify-content-left">
        <li class="nav-item">
          <a class="nav-link active" aria-current="page" href="#">
            Home
          </a>
        </li>
        <li class="nav-item">
          <a class="nav-link" href="#">
            Link
          </a>
        </li>
      </ul>
    );
}

export default HeaderLeftButtons;
